void AppGeneral::ClearCurrent()
{
  switch(GetTag()) {
  case Tag::Error:
    _Error.~Error();
    break;
  case Tag::RobotStatusRequest:
    _RobotStatusRequest.~RobotStatusRequest();
    break;
  case Tag::RobotStatusResponse:
    _RobotStatusResponse.~RobotStatusResponse();
    break;
  default:
    break;
  }
  _tag = Tag::INVALID;
}

