{
  return !(operator==(other));
}

void ExternalComms::ClearCurrent()
{
  switch(GetTag()) {
  case Tag::Error:
    _Error.~Error();
    break;
  case Tag::RtsConnection:
    _RtsConnection.~RtsConnection();
    break;
  case Tag::AppGeneral:
    _AppGeneral.~AppGeneral();
    break;
  case Tag::MeetVictor:
    _MeetVictor.~MeetVictor();
    break;
  default:
    break;
  }
  _tag = Tag::INVALID;
}

